import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Frankenstein'
        }, 
        {
          name: 'Dracula'
        }, 
        {
          name: 'Zombie'
        }
      ],
    }
  }

	render() {
		return (
			<div className="App">
				{
          this.state.monsters.map()
        }
			</div>
		);
	}
}

export default App;
